import React, { Component } from 'react'


class Compare extends Component{

    displayData = () =>{
        if(this.props.data){
           return  this.props.data.map(post=><h1>{post.id}</h1>)
        }
    }

    render(){


        return(
            <div className='compare box'>
                    {this.displayData()}
        </div>
        )
    }
}

export default Compare
